INSERT INTO courses (CourseCode, CourseName, Credits, Description) VALUES
('IT101', 'Nhập môn lập trình', 3, 'Kiến thức cơ bản về lập trình với Python.'),
('IT102', 'Cấu trúc dữ liệu và giải thuật', 4, 'Các cấu trúc dữ liệu cơ bản và thuật toán sắp xếp, tìm kiếm.'),
('IT201', 'Lập trình hướng đối tượng', 4, 'Nguyên lý và ứng dụng của lập trình hướng đối tượng với Java.'),
('IT203', 'Mạng máy tính', 3, 'Các khái niệm cơ bản về mạng, mô hình OSI, TCP-IP.'),
('SEC201', 'An ninh mạng cơ bản', 3, 'Tổng quan về các mối đe dọa và phương pháp phòng thủ.'),
('SEC301', 'Mật mã học', 4, 'Các hệ mật mã cổ điển và hiện đại.'),
('SE101', 'Quy trình phát triển phần mềm', 3, 'Các mô hình phát triển phần mềm như Waterfall, Agile, Scrum.'),
('SE202', 'Kiểm thử phần mềm', 3, 'Các kỹ thuật và phương pháp kiểm thử phần mềm.'),
('IS201', 'Cơ sở dữ liệu', 4, 'Thiết kế, triển khai và quản trị cơ sở dữ liệu quan hệ.'),
('IS302', 'Phân tích và thiết kế hệ thống', 3, 'Quy trình phân tích yêu cầu và thiết kế hệ thống thông tin.'),
('BA101', 'Quản trị học', 3, 'Các nguyên lý cơ bản của quản trị doanh nghiệp.'),
('BA102', 'Kinh tế vi mô', 3, 'Phân tích hành vi của người tiêu dùng và doanh nghiệp.'),
('MK101', 'Nguyên lý Marketing', 3, 'Các khái niệm và chiến lược Marketing căn bản.'),
('MK201', 'Marketing kỹ thuật số', 3, 'Sử dụng các công cụ số để thực hiện chiến dịch Marketing.'),
('EN101', 'Ngữ pháp tiếng Anh', 3, 'Củng cố và nâng cao kiến thức ngữ pháp.'),
('EN202', 'Kỹ năng viết học thuật', 3, 'Rèn luyện kỹ năng viết luận, báo cáo bằng tiếng Anh.');
